-- DROP TABLE IF EXISTS airports;

CREATE TABLE IF NOT EXISTS airports
             (
               id          serial primary key,
               icaoCode   char   ( 4)       ,
               iataCode   char   ( 3)       ,
               name        varchar(50)       ,
               city        varchar(50)       ,
               country     varchar(50)       ,
               latDeg     int               ,
               latMin     int               ,
               latSec     int               ,
               latDir     char   ( 1)       ,
               lonDeg     int               ,
               lonMin     int               ,
               lonSec     int               ,
               lonDir     char   ( 1)       ,
               altitude    int               ,
               latDecimal double precision  ,
               lonDecimal double precision
             );

